import './C2.css'
import {useState} from 'react';
import { Line } from "react-chartjs-2";


function C2() {
  const data=[
    {name:"raksha",value:330000},
    {name:"versha",value:500000},
    {name:"charu",value:600000}
  ]
  return(<>
      <div className="container2">
        <div className="header2">
          <h5 align="center">Tickets Solved By Agent</h5>
        </div>
          <div className="Graph1">
          <Line 
          data={{data}}  
        ></Line>
        
        </div>
      </div>
      </>
    );
  }
  
  export default C2;
